import React from 'react';


const getLetterCombos = (numInput) => {
  console.log('getting letter combos for ' + numInput);
  //axios request
}

function App() {
  const [numInput, setNumInput] = React.useState('');

  return (
    <div className="App">
      <h1>Phone Words</h1>
        <input 
          placeholder="e.g 234"
            onChange={(event) => {
                setNumInput(event.target.value);
            }}

            value={numInput}
        />
      <button onClick={() => {
        getLetterCombos(numInput) //make this async
      }}>Get letter combinations</button>
    </div>
  );
}

export default App;
